import ReactDOM from 'react-dom';
import './style.scss';
import React, { Component } from 'react';

class AboutUs extends Component {
  render(){
    return(
      <>
        <h1>Title</h1>
        <ul id="navBar">
          <li>About Us</li>
          <li>Houses</li>
          <li>Investments</li>
          <li>Contacts Us</li>
        </ul>
      </>
    )
  }
}

export default AboutUs;
